import { Link } from 'react-router-dom';

export default function Header() {
  return (
    <header>
      <a href="https://www.freecodecamp.org/news/object-object-in-javascript-meaning-in-js/" className="logo">Jade Blog</a>
      <nav>
        <Link href="/login" className="logo">Login</Link>
        <a href="https://www.freecodecamp.org/news/object-object-in-javascript-meaning-in-js/" className="logo">Register</a>
      </nav>
    </header>
  )
}
